def lemonade_change(bills):
    change = {5: 0, 10: 0, 20: 0}

    for bill in bills:
        if bill == 5:
            change[bill] += 1
        elif bill == 10:
            change[bill] += 1
            if change[5] > 0:
                change[5] -= 1
            else:
                return False
        else:
            if change[10] > 0 and change[5] > 0:
                change[10] -= 1
                change[5] -= 1
            elif change[5] > 2:
                change[5] -= 3
            else:
                return False

    return True


